import React from 'react';

class Avatar extends React.Component {
  render() {
    return (
      <div>
        <img
          className='Hall9000'
          src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fwallpaperplay.com%2Fwalls%2Ffull%2Fc%2F6%2Ff%2F139846.jpg&imgrefurl=https%3A%2F%2Fwallpaperplay.com%2Fboard%2Fhal-9000-wallpapers&tbnid=1H243hzc_fCMjM&vet=12ahUKEwin863V8PzpAhUKpBoKHVIlBYUQMygMegUIARDxAQ..i&docid=WDy2llbRkG8pFM&w=1920&h=1080&q=hal9000&client=ubuntu&ved=2ahUKEwin863V8PzpAhUKpBoKHVIlBYUQMygMegUIARDxAQ'
          alt='Hal9000'
        />
      </div>
    );
  }
}

export default Avatar;
